sectionedDescription:
{'authorType': 'human', 'description': 'The house is a detached house just outside the village of Zygos, about 10 km from all the northern beaches of Corfu and 19 km from Paleokastritsa. Located in nature, in absolute peace, it has a parking space, a terrace, washing machines for clothes and dishes. It has two bedrooms, one with two single beds and one with a double, as well as a sofa bed. It is fully equipped with kitchen utensils, towels and bed sheets, iron and hair dryer.

Το σπίτι είναι μονοκατοικία ακριβώς έξω από το χωριό Ζυγός, περίπου 10 χιλιόμετρα από όλες τις βόρειες παραλίες της Κέρκυρας και 19 χιλιόμετρα από την Παλαιοκαστρίτσα. Βρίσκεται μέσα στη φύση, σε απόλυτη ησυχία, διαθέτει χώρο πάρκινγκ, βεράντα, πλυντήρια ρούχων και πιάτων. Έχει δύο κρεβατοκάμαρες, μία με δύο μονά κρεβάτια και μία με ένα διπλό, καθώς και καναπέ κρεβάτι. Είναι πλήρως εξοπλισμένο με είδη κουζίνας, λευκά ήδη, σίδερο και πιστολάκι μαλλιών.

